B.O4=A.a(s(["Die H\xf6he des Elektronenstromes durch die Basis ist - da es sich um einen Diffusionsvorgang handelt - im Wesentlichen durch die Steigung dn`/dx der Ladungstr\xe4gerdichte (blaue Kurve) in der Basis gegeben. Also: Ic ~ dn\xb4/dx.","Die Tr\xe4gerdichten n` am emitter- bzw. kollektorseitigen Ende der Basis h\xe4ngen von der jeweiligen Spannung (UBE bzw. UBC) an dem \xdcbergang ab; es gilt n\xe4herungsweise n\xb4 ~ exp(U)."]),t.i)
