B.O2=A.a(s(["Der Bipolartransistor besteht aus drei unterschiedlich dotierten Gebieten (Emitter, Basis und Kollektor). Im Fall des npn-Transistors sind der Emitter (E) und der Kollektor (C) n-dotiert, die Basis (B) ist p-dotiert, so dass man zwei hintereinandergeschaltete pn-\xdcberg\xe4nge erh\xe4lt.","Transistor im normalen Verst\xe4rkerbetrieb\nIm normalen Verst\xe4rkerbetrieb ist der BE-\xdcbergang in Durchlassrichtung (UBE ~ 0,7V) und der BC-\xdcbergang ist gesperrt (UBC < 0V). \xdcber den in Durchlassrichtung gepolten BE-\xdcbergang bewegen sich Ladungstr\xe4ger (Elektronen) vom Emitter zur Basis (vgl. Diode). Diese ist sehr kurz (<1um), so dass die Elektronen nicht mit den vom Basisanschluss kommenden L\xf6chern rekombinieren, sondern (durch Diffusion) den BC-\xdcbergang erreichen. Sobald die Elektronen die Raumladungszone (X=XB) erreichen, werden sie durch das dort herrschende elektrische Feld zum Kollektor hin beschleunigt. Wichtig f\xfcr das Verst\xe4ndnis des Transistors sind folgende Aussagen:"]),t.i)
