B.Pe=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.i)
B.ag=A.a(s(["Englisch","Englisch"]),t.i)
B.Dr=new A.dn("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Pe,"Englisch",B.ag,null)
B.ON=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern der Fotodiode generiert. Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger. Umgekehrt f\xfchrt eine Verringerung der Bestrahlungsst\xe4rke zu einer Verringerung der Generationsrate.","Die durch die Bestrahlung generierten Ladungstr\xe4ger werden durch das eingebaute elektrische Feld E der Raumladungszone sofort getrennt und zu den neutralen Bahngebieten hin abtransportiert, ohne dass dazu eine externe Spannung notwendig ist. Der Fotostrom steht daher direkt an den Elektroden der Fotodiode zur Verf\xfcgung. Der Fotostrom ist proportional zu der Bestrahlungsst\xe4rke Ee und in erster N\xe4herung unabh\xe4ngig von der angelegten Spannung U (der Grund hierf\xfcr ist, dass das eingebaute elektrische Feld E der Raumladungszone bereits gro\xdf genug ist, um die Ladungstr\xe4ger auf ihre S\xe4ttigungsgeschwindigkeit zu beschleunigen. Eine weitere Erh\xf6hung des elektrischen Feldes durch \xc4nderung der Spannung U f\xfchrt dann zu keiner weiteren Erh\xf6hung der Geschwindigkeit der Ladungstr\xe4ger - und damit zu keinem Anstieg des Stromes)."]),t.i)
B.Ds=new A.dn("Dieses Applet veranschaulicht die Funktion einer Fotodiode. Die in der linken Bildh\xe4lfte des Applets schematisch dargestellte Fotodiode besitzt eine pin-Struktur, d.h. zwischen dem p- und dem n-Gebiet liegt ein undotiertes (intrinsisches) i-Gebiet (grau dargestellt). Das p- und das n-Gebiet bewirken eine \xfcber das gesamte i-Gebiet ausgedehnte Raumladungszone mit einer hohen elektrischen Feldst\xe4rke E. Aus Gr\xfcnden der \xdcbersichtlichkeit werden nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert. Die rechte Bildh\xe4lfte des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Hellgrau schattiert ist der dritte Quadrant der Kennlinie (U<0 und I<0); in diesem Quadranten arbeitet die Fotodiode im Diodenbetrieb. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\nMan sieht:\n",B.ON,"Englisch",B.ag,null)
B.P8=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Phosphor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (f\xfcnfwertige) P-Atome, so gehen jeweils vier der f\xfcnf Elektronen des Phosphor-Atoms (P) eine Bindung mit den benachbarten Si-Atomen ein; das f\xfcnfte Elektron bleibt jedoch ungebunden.",'Dieses f\xfcnfte Elektron, das keine Bindung eingegangen ist, kann bereits durch Zuf\xfchren geringer Ionisierungsenergie (z.B. geringe Temperaturerh\xf6hung) von dem Phosphor-Atom (P), dem so genannten Donator, gel\xf6st werden und wird dann zu einem "freien" Elektron. In dem B\xe4nderdiagramm entspricht diese geringe Ionisierungsenergie dem geringen Abstand des Donatorniveaus Wd zum Leitungsband Wc.',"Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (150K) alle Phosphoratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien Elektronen no gleich der Dichte ND der Dotierungsatome ist.","Der positive Atomrumpf (P+) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Durch das Dotieren erh\xf6ht sich demnach nur die Anzahl der freien Elektronen, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Wird die Temperatur weiter erh\xf6ht (T>300K) l\xf6sen sich - wie auch beim undotierten Halbleiter - immer mehr Bindungen zwischen den Si-Atomen und es entstehen zus\xe4tzliche Elektronen-Loch-Paare.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes, ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Phosphor dotierten Halbleiter die freien Elektronen ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem n-Typ Halbleiter."]),t.i)
B.Dt=new A.dn("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Phosphor) die Anzahl der zum Stromtransport wichtigen freien Elektronen erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.P8,"Englisch",B.ag,null)
B.NY=A.a(s(["F\xfcr T=0 nehmen die Elektronen ihren jeweils niedrigstm\xf6glichen Energiezustand an. Da nach dem Pauli-Prinzip ein Zustand jedoch nur mit maximal zwei Elektronen besetzt werden kann, sind auch von Null verschiedene Zust\xe4nde mit Elektronen besetzt. Die Energie, bis zu der bei T=0 alle Zust\xe4nde besetzt sind, bezeichnet man als das Ferminiveau Wf.","Die Besetzungswahrscheinlichkeit F(W) ist bei T=0 daher F(W)=1 f\xfcr alle Energieniveaus unterhalb des Ferminiveaus und F(W)=0 f\xfcr alle Energieniveaus oberhalb des Ferminiveaus.","Eine Erh\xf6hung der Temperatur T f\xfchrt zu einer Zunahme der Gesamtenergie in dem System. Dies \xe4u\xdfert sich darin, dass einzelne Elektronen auch h\xf6here Energiezust\xe4nde annehmen k\xf6nnen. Die Besetzungswahrscheinlichkeit F(W) h\xf6herer Zust\xe4nde nimmt daher zu und die niedriger Zust\xe4nde entsprechend ab.","Je h\xf6her die Temperatur ist, um so h\xf6her ist die Gesamtenergie des Systems. Die Wahrscheinlichkeit, dass ein energetisch hochliegender Zustand besetzt ist, steigt demnach mit zunehmender Temperatur immer weiter an. Gleichzeitig nimmt die Wahrscheinlichkeit, dass energetisch tiefliegende Zust\xe4nde besetzt sind, ab."]),t.i)
B.Du=new A.dn("Dieses Applet veranschaulicht die Bedeutung der Fermiverteilung F(W) und des Ferminiveaus anhand eines Systems mit diskreten Energiezust\xe4nden.\n\nMan sieht:\n",B.NY,"Englisch",B.ag,null)
B.Ps=A.a(s(["F\xfcr die gezeigte Anordnung eines gegengekoppelten Verst\xe4rkers, bei dem ein Teil k des Ausgangssignals wieder mit umgekehrtem Vorzeichen auf den Eingang zur\xfcckgef\xfchrt wird, ergibt sich allgemein eine Gesamtverst\xe4rkung ua/ue von:"]),t.i)
B.Dv=new A.dn("Diese Applet zeigt die Auswirkung der Gegenkopplung auf das \xdcbertragungsverhalten, d.h. die Verst\xe4rkung und die Linearit\xe4t, eines Verst\xe4rkers.\n\nMan sieht:\n",B.Ps,"Englisch",B.ag,null)
B.Nc=A.a(s(["Eine Erh\xf6hung des Stromes IB0 am Eingang f\xfchrt zun\xe4chst zu einem Anstieg des Stromes IC im Ausgangskreis. Gleichzeitig verringert sich die Spannung UCE am Ausgang, da der Spannungsabfall \xfcber Rc gr\xf6\xdfer wird.","Erh\xf6ht man das Eingangssignal immer weiter, wird die Spannung UCE am Ausgang sehr klein, so dass die Basis-Kollektor Diode schlie\xdflich in Durchlassrichtung geschaltet wird und der Transistor in S\xe4ttigung geht. Dadurch verringert sich die Stromverst\xe4rkung B. Der Strom IC steigt dann trotz weiterer Zunahme von IB0 nicht mehr weiter an.","Wird der Eingang des Verst\xe4rkers mit einem Sinussignal angesteuert (AC on), so muss ein geeigneter Eingangsruhestrom IB0 eingestellt werden, damit das Sinussignal vollst\xe4ndig \xfcbertragen wird."]),t.i)
B.Dw=new A.dn("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit Bipolartransistor.\n\nMan sieht:\n",B.Nc,"Englisch",B.ag,null)
B.NQ=A.a(s(["F\xfcr sehr gro\xdfe Basisweiten xB entspricht die Ladungstr\xe4gerverteilung der Basis-Emitter-Diode einem in Durchlassrichtung gepolten pn-\xdcbergang. Der Wert von n' an der Stelle x=0 wird dabei von der Spannung UBE \xfcber der Basis-Emitter-Diode bestimmt. Mit zunehmendem Abstand von der Raumladungszone nehmen die Minorit\xe4tstr\xe4gerdichten f\xfcr gro\xdfe Basisweiten dann exponentiell ab.","Der Basis-Kollektor-\xdcbergang des Transistors ist im Normalbetrieb in Sperrrichtung gepolt, so dass die \xdcberschussladungstr\xe4gerdichten n' und p' an den R\xe4ndern der Basis-Kollektor-Raumladungszone praktisch null sind.","Bringt man die beiden pn-\xdcberg\xe4nge sehr dicht zusammen, d.h. ist die Basisweite xB sehr klein, wird aus dem exponentiellen Verlauf der Ladungstr\xe4ger n' in der Basis (blaue Kurve) n\xe4herungsweise eine Gerade. Diese hat eine um so gr\xf6\xdfere Steigung, je kleiner die Basisweite xB ist."]),t.i)
B.Dx=new A.dn("Dieses Applet veranschaulicht die Ladungstr\xe4gerverteilung eines Bipolartransistors im Normalbetrieb f\xfcr unterschiedliche Basisweiten.\n\nMan sieht:\n",B.NQ,"Englisch",B.ag,null)
B.Pj=A.a(s(["Bei sehr niedrigen Temperaturen sind alle Bindungen im Halbleiterkristall intakt. Es sind keine freien Elektronen vorhanden, die zum Stromtransport beitragen k\xf6nnen. In der B\xe4nderdiagrammdarstellung bedeutet dies, dass sich alle Elektronen im so genannten Valenzband befinden; das obere Energieband (Leitungsband) ist unbesetzt.","Wird die zum L\xf6sen einer Bindung n\xf6tige Energie (z.B. durch Erh\xf6hung der Temperatur) \xfcberschritten, entstehen freie Elektronen. Diese freien Elektronen befinden sich in der B\xe4nderdiagrammdarstellung im so genannten Leitungsband. Der Abstand von Leitungsband zu Valenzband, der Bandabstand Wg, entspricht dabei der Energie, die zugef\xfchrt werden muss, um eine Bindung zu l\xf6sen.","An den Stellen, wo vorher die jetzt freien Elektronen sa\xdfen, bleibt jeweils eine L\xfccke (ein so genanntes Loch) zur\xfcck. Diesem Loch kann - wegen der fehlenden negativen Ladung des Elektrons - eine positive Ladung zugeordnet werden. Da in diese L\xfccke wiederum andere Elektronen springen k\xf6nnen, tragen auch L\xf6cher zum Ladungstransport bei.","Durch das L\xf6sen von Bindungen zwischen Si-Atomen werden L\xf6cher und Elektronen paarweise generiert, so dass ihre Anzahl stets gleich gro\xdf ist.","Die Zahl der freien Ladungstr\xe4ger (Elektronen und L\xf6cher) in einem undotierten Halbleiter ist bei moderaten Temperaturen \xe4u\xdferst gering. Erst bei sehr hohen Temperaturen steigt die Anzahl der freien Ladungstr\xe4ger deutlich an. Durch Dotieren, d.h. den Einbau von Fremdatomen in den Halbleiter, kann jedoch die Zahl der freien L\xf6cher oder Elektronen gezielt ver\xe4ndert und bereits bei Raumtemperatur deutlich erh\xf6ht werden."]),t.i)
B.Dy=new A.dn("Ein undotierter Silizium-Halbleiter besteht ausschlie\xdflich aus vierwertigen Siliziumatomen (Si), die in einer regelm\xe4\xdfigen Kristallstruktur angeordnet sind. Dabei gehen die vier Valenzelektronen eines jeden Siliziumatoms so genannte kovalente Bindungen mit den Elektronen der benachbarten Si-Atome ein. Das Applet zeigt das Verhalten eines undotierten Halbleiters bei \xc4nderung der Temperatur. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im so genannten B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Pj,"Englisch",B.ag,null)
B.Na=A.a(s(["Bei niedrigen Temperaturen (hier: 300K) ist das Atom in einem energetisch niedrigen Zustand. In dem dargestellten Atommodell befindet sich das Elektron auf der inneren Schale.","Durch Erh\xf6hen der Temperatur gelangt das Elektron auf eine weiter au\xdfen liegende Schale. Dies entspricht einem angeregten Energiezustand.","Tr\xe4gt man die m\xf6glichen Energiewerte W, die das Atom annehmen kann, in einem einfachen Diagramm auf, so ergeben sich mehrere diskrete Zust\xe4nde (Energielinien), deren Anzahl und Abst\xe4nde f\xfcr das Atom charakteristisch ist."]),t.i)
B.Dz=new A.dn("Atome k\xf6nnen unterschiedliche Energiezust\xe4nde annehmen. Dieses Applet zeigt in einer stark vereinfachten Darstellung einen Atomkern (rot) mit einem Valenzelektron (blau), welches durch Zuf\xfchren von W\xe4rmeenergie angeregt wird.\n\nMan sieht:\n",B.Na,"Englisch",B.ag,null)
B.Od=A.a(s(["F\xfcr eine gegebene Spannung UBE liefert der Schnittpunkt der jeweiligen Transistorausgangskennlinie mit der Lastgeraden den Wert des Stromes IC sowie der Ausgangsspannung UCE.","Soll eine sinusf\xf6rmige Basis-Emitter-Spannung (AC on) verst\xe4rkt werden, so ergibt sich die beste Verst\xe4rkerwirkung, wenn das Signal um eine Spannung UBE0 herum ge\xe4ndert wird, die in etwa in der Mitte des aussteuerbaren Bereiches, d.h. UBE0=0.72V, liegt.","Bei gr\xf6\xdferen oder kleineren Werten von UBE0 arbeitet der Transistor entweder im S\xe4ttigungs- oder im Sperrbetrieb, so dass die Verst\xe4rkung deutlich abnimmt."]),t.i)
B.DA=new A.dn("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit passiver Last.\n\nMan sieht:\n",B.Od,"Englisch",B.ag,null)
B.OJ=A.a(s(["Das Anlegen einer Drain-Source Spannung UDS f\xfchrt nur dann zu einem Strom IDS durch den Transistor, wenn die Gate-Source Spannung UGS gr\xf6\xdfer ist als die Einsatzspannung Uth,n, da sich erst dann ein leitender Kanal unter dem Gate bildet.","\xdcberschreitet die Gate-Source Spannung UGS die Einsatzspannung Uth,n, so bildet sich ein leitender Kanal unterhalb des Gates und es kann ein Strom flie\xdfen, wenn eine Spannung UDS angelegt wird.","Der Strom IDS steigt - bei konstantem UGS - zun\xe4chst mit gr\xf6\xdfer werdender Spannung UDS stark an. Diesen Bereich bezeichnet man als Widerstandsbereich.","Mit gr\xf6\xdfer werdender Spannung UDS erreicht der Strom jedoch einen S\xe4ttigungswert und steigt dann nur noch geringf\xfcgig an. Dieser Bereich wird als S\xe4ttigungsbereich bezeichnet."]),t.i)
B.DB=new A.dn("Dieses Applet veranschaulicht die Funktionsweise des Feldeffekttransistors, der aus einer MOS-Struktur mit anschlie\xdfenden Source und Drain-Gebieten besteht. Nach Vorgabe der Gate-Source-Spannung UGS und der Drain-Source-Spannung UDS wird der Strom IDS durch den Transistor berechnet. Der entsprechende Arbeitspunkt wird im Ausgangskennlinienfeld als roter Punkt eingezeichnet. Zus\xe4tzlich wird der Kanal unter dem Gate dargestellt, um Effekte wie Kanalabschn\xfcrung und Kanall\xe4ngenmodulation sowie die Wirkung der Einsatzspannung (hier: Uth,n=0.8V) zu verdeutlichen.\nMan sieht:\n",B.OJ,"Englisch",B.ag,null)
B.NT=A.a(s(["Bei undotierten Halbleitern liegt das Ferminiveau etwa in der Mitte des verbotenen Bandes.","Dotiert man den Halbleiter mit Donatoren (Erh\xf6hung von ND), so wandert der Schnittpunkt der beiden Kurven zur Leitungsbandkante Wc. Bei einer Dotierung mit Akzeptoren wandert das Ferminiveau entsprechend zur Valenzbandkante Wv.","Wird der Halbleiter sowohl mit Donatoren als auch mit Akzeptoren dotiert, so wird das Verhalten des Halbleiters (n- oder p-Typ) allein durch die Dotieratome mit der h\xf6heren Konzentration bestimmt.","Da f\xfcr einen undotierten Halbleiter die Tr\xe4gerdichten n0 und p0 gleich der Eigenleitungstr\xe4gerdichte ni sind und das Ferminiveau WF gleich dem Eigenleitungsniveau Wi ist, folgen unmittelbar die wichtigen Beziehungen:"]),t.i)
B.DC=new A.ER(null)
B.O7=A.a(s(["Liegt das Ferminiveau in der Mitte zwischen Valenz- und Leitungsbandkante (undotierter Halbleiter), so sind die Kurven nw und pw symmetrisch zu Wf. Insbesondere sind die Fl\xe4chen unter den beiden Kurven und damit die Anzahl der freien Ladungstr\xe4ger n0 und p0 gleich gro\xdf.","Eine Erh\xf6hung der Temperatur f\xfchrt wegen des sich \xe4ndernden Verlaufes der Fermiverteilung zu einer Erh\xf6hung beider Tr\xe4gerdichten.","Bei einem n-dotierten Halbleiter, bei dem das Ferminiveau Wf und damit die gesamte Kurve F(W) nach oben verschoben ist, ergibt die Multiplikation und anschlie\xdfende Integration der Kurven einen h\xf6heren Wert f\xfcr die Elektronendichte n0 und einen kleineren Wert f\xfcr die L\xf6cherdichte p0. Umgekehrtes gilt f\xfcr einem p-Typ Halbleiter. Die Lage des Ferminiveaus Wf bestimmt also unmittelbar die Tr\xe4gerdichten im thermodynamischen Gleichgewicht."]),t.i)
B.DD=new A.ES(null)
B.NR=A.a(s(["Eine Polstelle bewirkt einen Abfall des Betrages der \xdcbertragungsfunktion ab einer Grenzfrequenz, die von der Lage des Pols abh\xe4ngt. Je n\xe4her der Pol an der komplexen Achse liegt, um sehr niedriger ist die entsprechende Grenzfrequenz. Ebenfalls erfolgt eine Phasendrehung bei der Grenzfrequenz um -90 Grad.","Eine Nullstelle bewirkt einen Anstieg des Betrages der \xdcbertragungsfunktion sowie eine Phasendrehung um +90 Grad bei der zu der Nullstelle geh\xf6renden Grenzfrequenz.","Existieren mehrere Pol- oder Nullstellen, so \xfcberlagern sich deren Wirkungen. Insbesondere kompensieren sich Null- und Polstellen gegenseitig, wenn sie an der gleichen Stelle in der komplexen Ebene liegen.","Konjugiert komplexe Pole f\xfchren wegen des imagin\xe4ren Anteils zu Sinus- und Cosinus-Anteilen in der Sprungantwort. Der Realteil f\xfchrt zu einer exponentiellen D\xe4mpfung, wenn die Polstelle in der linken Halbebene liegt und zu einer ansteigenden Schwingung, wenn der Realteil des Poles positiv ist."]),t.i)
B.DE=new A.dn("Dieses Applet zeigt den Einfluss der Lage von Pol- (x) und Nullstellen (o) einer komplexen \xdcbertragungsfunktion auf den Amplituden- und Phasengang sowie die Sprungantwort. Im unteren, linken Fenster des Applets lassen sich Pol- und Nullstellen hinzuf\xfcgen, verschieben und l\xf6schen.\n        \nMan sieht: \n        ",B.NR,"Englisch",B.ag,null)
B.Ni=A.a(s(["Liegt keine \xe4u\xdfere Spannung \xfcber der Struktur (U=0V), ist der pn-\xdcbergang im thermodynamischen Gleichgewicht (TGG). In der gezeigten B\xe4nderdiagrammdarstellung liegt das Ferminiveau Wf im TGG \xfcberall auf gleicher H\xf6he. In diesem Fall liegen auch die Pegel der Elektronen im p- und im n-Gebiet auf gleicher H\xf6he, so dass keine Netto-Ausgleichsbewegung, d.h. Bewegung von Elektronen von einem Gebiet in das andere, erfolgt. Entsprechendes gilt f\xfcr die L\xf6cher, deren Pegel ebenfalls auf gleichem Niveau liegen.","Durch das Anlegen einer \xe4u\xdferen elektrischen Spannung U>0V an die Struktur verschieben sich die Bandkanten gem\xe4\xdf U=-W/q, wobei in der Darstellung der Anschaulichkeit halber der ohmsche Spannungsabfall im Halbleitermaterial (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm) vernachl\xe4ssigt ist. Der Pegel der Elektronen im n-Gebiet liegt in diesem Fall \xfcber dem der Elektronen in p-Gebiet, so dass Elektronen durch die Raumladungszone in das p-Gebiet wandern. Diese \xfcbersch\xfcssigen Elektronen f\xfchren zu einer lokalen St\xf6rung des TGG, und damit einer Zunahme der Rekombination (G<R) der \xfcbersch\xfcssigen Elektronen mit L\xf6chern, die st\xe4ndig aus dem p-Gebiet nachgeliefert werden, was einem Stromfluss entspricht. Entsprechende \xdcberlegungen gelten f\xfcr die L\xf6cher, deren Pegel im p-Gebiet unter dem im n-Gebiet liegt.","Bei einer Spannung U<0V verschieben sich die B\xe4nder in umgekehrte Richtung, so dass nun Minorit\xe4tstr\xe4ger \xfcber die Raumladungszone in das benachbarte Gebiet gelangen k\xf6nnen. Wegen der sehr geringen Tr\xe4gerdichte der Minorit\xe4tstr\xe4ger wandern jedoch nur sehr wenige Ladungstr\xe4ger durch die Raumladungszone, was einem sehr kleinen Strom entspricht, der auch mit zunehmender Sperrspannung nicht wesentlich ansteigt."]),t.i)
B.DF=new A.dn("Dieses Applet zeigt f\xfcr einen pn-\xdcbergang die Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.Ni,"Englisch",B.ag,null)
B.O1=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.i)
B.DG=new A.dn("Das Applet zeigt die Auswirkungen auf die m\xf6glichen Energiezust\xe4nde W zweier einzelner Atome, wenn diese miteinander in Wechselwirkung gebracht werden, indem man den Abstand zwischen ihnen verringert.\n\nMan sieht:\n",B.O1,"Englisch",B.ag,null)
B.Pc=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.i)
B.nl=new A.dn(u.k,B.Pc,"Englisch",B.ag,null)
B.Oo=A.a(s(["Liegt das Ferminiveau WF in der Mitte zwischen den beiden Bandkanten auf dem Intrinsicniveau Wi, so sind die Elektronendichte und die L\xf6cherdichte gleich der Intrinsicdichte ni.","Eine Verschiebung des Ferminiveaus zur Leitungsbandkante (was einem n-Typ Halbleiter entspricht) f\xfchrt zu einem Anstieg der Elektronendichte n0 und einer Abnahme der L\xf6cherdichte p0.","Bei einem p-Typ Halbleiter, bei dem das Ferminiveau zur Valenzbandkante verschoben ist, ist dagegen die L\xf6cherdichte erh\xf6ht und die Elektronendichte vermindert.","In allen F\xe4llen gilt, dass (im thermodynamischen Gleichgewicht) das Produkt aus Elektronendichte und L\xf6cherdichte gleich ni^2 ist (Massenwirkungsgesetz), was sich in der logarithmischen Darstellung deutlich zeigt."]),t.i)
B.DH=new A.ET(null)
B.OH=A.a(s(["F\xfcr UBE=0V und UCE=5V ist sowohl der Basis-Kollektor \xdcbergang als auch der Basis-Emitter \xdcbergang in Sperrrichtung gepolt, so dass kein Strom durch den Transistor flie\xdft, d.h. IE=IC=0.","Erh\xf6ht man die Basis-Emitter Spannung auf etwa UBE=0,7V, so wird der Basis-Emitter \xdcbergang in Durchlassrichtung gepolt. Dies f\xfchrt (vgl. Diode) zum einen dazu, dass L\xf6cher vom p-Gebiet (der Basis) in das n-Gebiet (den Emitter) diffundieren und dort rekombinieren. Zum anderen diffundieren Elektronen umgekehrt von dem n-Gebiet in die Basis. Da die Basisweite jedoch sehr klein ist, rekombinieren die Elektronen dort nicht, sondern gelangen bis in den n-dotierten Kollektor. Die angelegte Basis-Emitter Spannung f\xfchrt somit zu einem Elektronenstrom vom Emitter durch das Basisgebiet bis hin zum Kollektor."]),t.i)
B.DI=new A.dn("Dieses Applet veranschaulicht die Funktion des Bipolartransistors.\n\nMan sieht:\n",B.OH,"Englisch",B.ag,null)
B.Oq=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.i)
B.DJ=new A.dn("Dieses Applet zeigt die Konstruktion der \xdcbertragungskennlinie UCE.\n\nMan sieht:\n",B.Oq,"Englisch",B.ag,null)
B.Nh=A.a(s(["Bei einem einzigen Atom (n=1) erh\xe4lt man zwei m\xf6gliche Energiezust\xe4nde, von denen der untere besetzt ist.","Bei zwei Atomen (n=2) spalten sich die Energiezust\xe4nde wegen der Kopplung zwischen den beiden Atomen auf.","Erh\xf6ht man die Anzahl der Atome weiter, so spalten sich die Energieniveaus immer weiter auf, bis diese bei einer sehr gro\xdfen Anzahl von Atomen (hier n=16) so dicht beieinander liegen, dass man nicht mehr von Energielinien sondern von Energieb\xe4ndern spricht.","Da in diesem Beispiel eine sehr niedrige Umgebungstemperatur angenommen wurde, befinden sich alle Elektronen in dem jeweils niedrigsten Energiezustand, d.h. in dem unteren Energieband. Das obere Energieband ist unter diesen Bedingungen vollst\xe4ndig unbesetzt."]),t.i)
B.DK=new A.dn("Dieses Applet illustriert den \xdcbergang von einem einzelnen Atom zu einem Kristall mit einer sehr gro\xdfen Zahl von regelm\xe4\xdfig angeordneten Atomen, wobei der Abstand der Atome untereinander so gering ist, dass die Atome miteinander in Wechselwirkung stehen. Die Umgebungstemperatur sei in dem Beispiel sehr niedrig, so dass jeweils die untersten Energiezust\xe4nde besetzt sind.\n\nMan sieht:\n",B.Nh,"Englisch",B.ag,null)
B.Pi=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.i)
